import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import RootLayout from "./screens/RootLayout";
import MainPage from "./screens/MainPage";
import SignInPage from "./screens/SignInPage";
import NowPlayingPage from "./screens/NowPlayingPage";
import PopularPage from "./screens/PopularPage";
import TopRatedPage from "./screens/TopRatedPage";
import UpComingPage from "./screens/UpComing";

function App() {
  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={
            <RootLayout>
              <MainPage />
            </RootLayout>
          }
        />
        <Route
          path="/signIn"
          element={
            <RootLayout>
              <SignInPage />
            </RootLayout>
          }
        />
        <Route
          path="/nowPlaying"
          element={
            <RootLayout>
              <NowPlayingPage />
            </RootLayout>
          }
        />
        <Route
          path="/popular"
          element={
            <RootLayout>
              <PopularPage />
            </RootLayout>
          }
        />
        <Route
          path="/topRated"
          element={
            <RootLayout>
              <TopRatedPage />
            </RootLayout>
          }
        />
        <Route
          path="/upComing"
          element={
            <RootLayout>
              <UpComingPage />
            </RootLayout>
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
